REM first create trigger so we do not have rely on our own
CREATE OR REPLACE TRIGGER ESA.ITEM_TRIGGER before
	INSERT ON ESA.ITEM FOR EACH row BEGIN IF inserting THEN IF :NEW."ID" IS NULL THEN
	SELECT ITEM_SEQ.nextval INTO :NEW."ID" FROM dual;
END IF;
END IF;
END;
/
ALTER TRIGGER ESA.ITEM_TRIGGER ENABLE;


